.
🍗 Terbuat dari ayam yang diproses marinasi, kemudian dibalut tepung berkali-kali dan digoreng garing. 
🍗 Teksturnya renyah di bagian luar, dan dagingnya gurih dan juicy. 
🍗 Berat 500gr (kurang lebih isi 7-10 pcs, tergantung besar kecilnya ayam).
.
HARGA: 42k
.
CARA PENYAJIAN:
Keluarkan Fried Chicken dari freezer hingga tidak beku. Goreng dengan api yang panas, pastikan ayam terendam minyak seluruhnya (deep-frying). Setelah berwarna kuning keemasan, angkat dan tiriskan.
.
CATATAN PENTING:
1. Sangat disarankan disimpan di dalam freezer (daya tahan 4 minggu di freezer).
2. Pengiriman hanya untuk wilayah JADETABEK, menggunakan kurir GOSEND/GRAB DELIVERY (Instant/Same Day).
3. Untuk Same Day Delivery, maksimal order pada jam 13.00 WIB. Dan untuk Instant Courier, maksimal order pada jam 15.00 WIB. 
4. Jangan khawatir, untuk yang order di atas jam tersebut, kami akan kirimkan segera di esok harinya ya.
.
